O contrainte faſcheuſe ou ie ſuis obligé!
Ie te plains dans le cœur, pauure Prince affligé;
Mais ſi i'acheue en fin le deſſein que ie trame,
Phraarte en te ſauuant, ſe ſauuera de blaſme.
C'eſt le Roy mon Seigneur, qui me fait t'aduertir
De luy rendre la place, & d'en vouloir ſortir;
Car ſi tu ne le fais, conſulte, delibere;
I'ay le commandement de poignarder ton pere.
